import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Wrapper from '../../Common/Wrapper';
import List from './list';
import Create from './create';

function Fruits(){
    return (
        <>
            <h1>Fruits</h1>

            <Row>
                <Col>
                    <Create />
                </Col>

                <Col>
                    <List />
                </Col>
            </Row>
        </>
    )
}

export default Fruits;
